- :annotations:
    :comment: 'Self-governing to some limited degree; considered an integral part
      of an independent country. Example: Christmas Island is a territory of Australia;
      administered by the Australian Department of Transport and Regional Services.
      Christmas Island does not have the right to move to full independence by unilateral
      action.'
  :sub_class_of:
  - :id: http://webprotege.stanford.edu/RDhJROAIGsxgfbTwDSShcXp
    :label: Countries by status
  :label: Fully Dependent Territory
  :datatype_properties: {}
  :object_properties: {}
  :subject: http://webprotege.stanford.edu/R7M8mdkemRyxz15TmEssvNP
- :annotations:
    :comment: 'No government body exists. The territory is not or cannot be claimed
      by an independent country. Example: Antarctica is unclaimed resp. unclaimable
      territory. An Antarctic Treaty was negotiated that neither denies nor gives
      recognition to existing territorial claims.'
  :sub_class_of:
  - :id: http://webprotege.stanford.edu/RDhJROAIGsxgfbTwDSShcXp
    :label: Countries by status
  :label: Unclaimed Territory
  :datatype_properties: {}
  :object_properties: {}
  :subject: http://webprotege.stanford.edu/R7t6wK3B5vUlkmdz0ZD691V
- :annotations:
    :comment: 'A disputed state is regarded as an independent state by its own population
      (or at least the majority of them) and has been recognized as independent by
      some international body (e.g. the U.N.) at some point in the past. However,
      a disputed territorys status of independence is questioned by some other independent
      country/countries. Example: The Republic of China (Taiwan) and the Peoples Republic
      of China hold differing views on the sovereignty of Taiwan.'
  :sub_class_of:
  - :id: http://webprotege.stanford.edu/RDhJROAIGsxgfbTwDSShcXp
    :label: Countries by status
  :label: Independent Disputed State
