- :annotations:
    :comment: 'Self-governing in free association with some independent country. An
      assoiated state is neither occupied nor annexed, nor is its territory considered
      an integral part of the country it is associated with. Example: Cook Islands
      is fully responsible for internal affairs; New Zealand retains responsibility
      for external affairs and defense, in consultation with the Cook Islands. Cook
      Islands has the right at any time to move to full independence by unilateral
      action.'
  :sub_class_of:
